import React, {Comactponent, Component} from "react";
import ReactDOM from "react-dom";
import "./assets/styles.css";


class QuizBee extends Component {
    render(){
        return(
            <div class="container">
            <div className="title">
                QuizBee App
            </div>
            </div>
        )
    }
}


ReactDOM.render(<QuizBee />, document.getElementById("root"));
